'use strict';
class OrdersProvider {
    ordersManager;
    getCalculatedOrderById(orderId) {
        return this.ordersManager.getOrderById(orderId);
    }
    getRawOrdersForTrade(tradeId) {
        return this.ordersManager.getRawOrdersForTrade(tradeId);
    }
    getRawOrdersForPrimaryOrderId(primaryOrderId) {
        return this.ordersManager.getRawOrdersForPrimaryOrderId(primaryOrderId);
    }
    setManager(ordersManager) {
        this.ordersManager = ordersManager;
    }
}
module.exports = OrdersProvider
